import React, { useEffect } from "react";
import { useState } from "react";
import itinerariesActions from "../redux/actions/itinerariesActions";
import { useDispatch, useSelector } from "react-redux"
import { useParams } from "react-router-dom";



let emoji = "ðŸ’µ"

function Itineraries(){
    const {id}= useParams()
    const dispatch = useDispatch()
    useEffect(()=>{
        dispatch(itinerariesActions.findTinFromCity(id))
    },[])
    const itinerary = useSelector(store=>store.itinerariesReducer.itinerary)
    console.log(itinerary)
    return(

        <div className="itinerary">
            <div className="photo">
                <img src={itinerary.personPhoto} alt="photo" />
            </div>
            <div className="personName">
                <p>{itinerary[0].person}</p>
            </div>
            <div className="itinerary-body">
                <h1>{itinerary.itineraryName}</h1>
                <p>{emoji.repeat(itinerary.price)}</p>
                <p>{itinerary.duration}</p>
                <p>{itinerary.likes}</p>
            </div>
        </div>

        
    )
}
export default Itineraries
